window.bookSummaryJSON = "<p>The antichrist is supposed to rule the world, but Chris kind of told the ghost of his father-in-law he’d rather have the love of his wife. And he’d meant it...at the time.&nbsp;</p> <p>However, Chris was born with a destiny. He is the prince in waiting. The Destroyer of Nations. A failure with no magic, no armies, and now, no longer even a psychotic mother he can call upon. Is he destined for a mundane life?&nbsp;</p> <p>Good thing fate has other plans: plans that include him becoming Hell’s king.</p>"; 
